import React from 'react';
import {
  List,
  Show,
  SimpleShowLayout,
  Datagrid,
  TextField,
  RichTextField,
  DateField
} from 'react-admin';

export const SupportList = props => (
  <List {...props}>
    <Datagrid>
      <TextField source="title" />
      <TextField source="message" />
      <TextField source="email" />
    </Datagrid>
  </List>
);

export const SupportShow = (props) => (
    <Show {...props}>
        <SimpleShowLayout>
            <TextField source="title" />
            <RichTextField source="message" />
            <TextField source="email" />
            <DateField source="created_at" />
        </SimpleShowLayout>
    </Show>
);
